import {Container, Carousel, Card, Row, Col} from 'react-bootstrap';
import Depan from '../component/utama.jpg';

export default function HalamanUtama(){
	return(

		<>
		<Container fluid>
		  <Row>
		    <div style={{backgroundImage: `url(${Depan})`, backgroundSize: 'cover', width:'100%'}}>
		    <center>
		    <p style={{color: 'white', fontSize: '80px', textDecoration: 'bold'}}><b>BIG FAMILY</b></p>
		    </center>
		    </div>
		  </Row>
		</Container>

		</>


		);
}
